from typing import List

def min_moves(nums: List[int], L: int) -> int:
    """"""
    high = max(max(nums), L)
    low = min(nums)
    while low <= high:
        mid = low + (high - low) // 2
        total = sum((mid - num for num in nums))
        if total > mid or mid > L:
            return -1
        if total <= mid:
            high = mid - 1
        else:
            low = mid + 1
    return high
